import { Helmet } from 'react-helmet';
import {
  Box,
  Container,
  Grid
} from '@material-ui/core';
import VitalsTable from 'src/components/dashboard/VitalsTable';
import Sales from 'src/components/dashboard//Sales';
import Spo from 'src/components/vitals/Spo';
import BP from 'src/components/vitals/BP';
import Rr from 'src/components/vitals/Rr';
import Temprature from 'src/components/vitals/Temprature';

const Dashboard = () => (
  <>
    <Helmet>
      <title>Dashboard | Material Kit</title>
    </Helmet>
    <Box
      sx={{
        backgroundColor: 'background.default',
        minHeight: '100%',
        py: 3
      }}
    >
      <Container maxWidth={false}>
        <Grid
          container
          spacing={3}
        >
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
            <BP />
          </Grid>
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
            <Rr />
          </Grid>
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
            <Spo />
          </Grid>
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
            <Temprature />
          </Grid>
          <Grid
            item
            lg={12}
            md={16}
            xl={12}
            xs={16}
          >
            <Sales />
          </Grid>
          <Grid
            item
            lg={12}
            md={16}
            xl={12}
            xs={16}
          >
            <VitalsTable />
          </Grid>
        </Grid>
      </Container>
    </Box>
  </>
);

export default Dashboard;
